import React from 'react';
import { TextField, Button, TextareaAutosize } from '@mui/material';
import Instagram from './Images/icons8-instagram-reels-50.png';
import Twitter from './Images/icons8-twitter-50.png';
import Facebook from './Images/icons8-facebook-50.png';
import emailjs from '@emailjs/browser';

const sendMail = (e) => {
  e.preventDefault();
  emailjs
    .sendForm(
      'service_9j6ww1d',
      'template_33yot59',
      e.target,
      'c73X1yR75zwImw7cp'
    )
    .then(
      (result) => {
        console.log(result.text);
      },
      (error) => {
        console.log(error.text);
      }
    );
};
const Contact = () => {
  return (
    <div className=" content bg-color " id="contact-us">
      <h1>Contact</h1>
      <div className="form">
        <form noValidate autoComplete="off" onSubmit={sendMail}>
          <TextField
            required
            id="standard-full-width"
            fullWidth
            variant="filled"
            focused
            label="Name"
            name="Name"
            style={{ background: '#fff', borderRadius: 4 }}
          />
          <br></br>
          <br></br>
          <TextField
            required
            id="standard-full-width"
            fullWidth
            variant="filled"
            focused
            label="Email"
            name="Email"
            style={{ background: '#fff', borderRadius: 4 }}
          />
          <br></br>
          <br></br>
          <TextareaAutosize
            required
            aria-label="empty textarea"
            placeholder="Empty"
            style={{
              width: 710,
              height: 300,
              backgroundColor: 'transparent',
              borderRadius: 4,
              outline: 'none',
              color: 'white',
              fontSize: 20,
            }}
          />
          <TextField
            required
            id="standard-full-width"
            fullWidth
            variant="filled"
            focused
            label="Message"
            name="Message"
          />
          <br></br>
          <br></br>
          <Button type="sumbit" variant="contained" color="primary">
            Submit
          </Button>
        </form>
      </div>

      <article className="social">
        <img src={Facebook} />
        <img src={Instagram} />
        <img src={Twitter} />
      </article>
    </div>
  );
};

export default Contact;
